import React, {Component, useState, useEffect} from 'react';
import {Button, Image, Card, CardDeck, ListGroup} from 'react-bootstrap';
import '../css/Home.css'
import myPicutre from '../images/myPicture/HomeMyPicture.jpg';

function Home(props){
	var state = useState();
	return(	
		<div className="container">
			<Card className="bg-dark text-black" text="dark">
				<Card.Img src={myPicutre} alt="Home image" />
				<Card.ImgOverlay>
					<Card.Title><h1>Coming Soon</h1></Card.Title>
					<Card.Text >
						Developing..
					</Card.Text>
				</Card.ImgOverlay>
			</Card>
			<hr / >
			<Card className="text-center">
			<Card.Header>Featured</Card.Header>
			<Card.Body>
				<Card.Title>Special title treatment</Card.Title>
				<Card.Text>
				With supporting text below as a natural lead-in to additional content.
				</Card.Text>
				<Button variant="primary">Go somewhere</Button>
			</Card.Body>
			<Card.Footer className="text-muted">2 days ago</Card.Footer>
			</Card>
		</div>
	);
}

export default Home;
